function whatIsInAName(collection, source) {

  // Only change code below this line
  let proccessArr = [...collection];

  let sourceProp = Object.keys(source);
  let res  = proccessArr.filter(obj => {
    return sourceProp.every(x => obj.hasOwnProperty(x) == true)
  }).filter(obj => {
    return sourceProp.every(y => obj[y] === source[y])
  });
  // console.log(collection);
  // console.log(source);
  // console.log(res)

  // Only change code above this line
  return res;
}

